import React, {Component} from 'react';
import styled, {css} from 'styled-components';


class KeyMetric extends Component {
    render (){
        return(
        <div>
            <h2>Keye Meetric</h2>
            <div id ="metric">
                <div> Moat </div>
                <div> No.of Fund owning </div>
                <div> Sharpe Ratio </div> 
                <div> Market Cap </div>
                <div> Sector </div> 
            </div>
            <div id ="metric">
                <div> Price/Sales </div>
                <div> Price/Earnings </div>
                <div> Forward P/E </div> 
                <div> Price/Bookp </div>
                <div> PEG Ratio </div> 
            </div>
            <div id ="metric">
                <div> Rev 3-Yr Growth </div>
                <div> ROE % </div>
                <div> Operating Margin </div> 
                <div> Div Yield </div>
                <div> Current Ratio </div> 
            </div>
        </div>
      );
    }
}
export default KeyMetric;
